// MiniQLLexerInit initializes any static state used to implement MiniQLLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewMiniQLLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func MiniQLLexerInit() {
  staticData := &MiniQLLexerLexerStaticData
  staticData.once.Do(miniqllexerLexerInit)
}

// NewMiniQLLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewMiniQLLexer(input antlr.CharStream) *MiniQLLexer {
  MiniQLLexerInit()
	l := new(MiniQLLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
  staticData := &MiniQLLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "MiniQL.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

